import React, { Component } from 'react';
import { AppBar, Menu, MenuItem, Toolbar, Typography } from '@material-ui/core';

class Header extends Component {
    constructor(props:any) {
        super(props);
        this.state = { anchorEl : null};
    }

    render() {
        const open = Boolean(true);

        return (
            <AppBar position="static">
                <Toolbar>
                    <Typography variant="h6" color="inherit">
                        GRU
                    </Typography>
                    <div>
                        <Menu id="menu" anchorOrigin={{vertical: 'top',horizontal:'right',}} transformOrigin={{vertical: 'top',horizontal:'right',}} open={open}>
                            <MenuItem >Item 1</MenuItem>
                            <MenuItem >Item 2</MenuItem>
                            <MenuItem >Item 3</MenuItem>
                        </Menu>
                    </div>
                </Toolbar>
            </AppBar>
        );
    }
}


const AappHeader = () => (

    <AppBar position="static">
        <Toolbar>
            <Typography variant="h6" color="inherit">
                GRU
            </Typography>
        </Toolbar>
    </AppBar>
);

export default AappHeader;
